const footerStyle = {
  textAlign: 'center',
  padding: '3rem 1rem',
  scrollSnapAlign: 'top',
}

const HomeFooterSection = () => {
  const generateEmailAddress = (event) => {
    let dataset = event.target.dataset;
    event.target.href = 'mailto:' + dataset.name + '@' + dataset.domain + '.' + dataset.tld;
  }

  return <footer style={footerStyle}>
    <a href="https://mudev.cc">mudev.cc</a> | MUsoftware (
    <a href="#"
      data-name="musoftware"
      data-domain="mudev"
      data-tld="cc"
      onClick={(e) => generateEmailAddress(e)} >
      Contect to MUsoftware
    </a> )<br />
  </footer>
}

export { HomeFooterSection };
